var title_f25_19_25916="Liquid preparations of antiretroviral agents for adults";
var content_f25_19_25916=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F71499&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F71499&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Available liquid preparations of antiretroviral agents for adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Liquid available?",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antiretroviral agents",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Liquid formulation available (and relatively practical for adults)",
"       </td>",
"       <td>",
"        Zidovudine, lamivudine, abacavir, nevirapine, emtricitabine, fosamprenavir",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Liquid formulation available (but not very palatable for most adults; OK for nasogastric and feeding tubes)",
"       </td>",
"       <td>",
"        Ritonavir, lopinavir/ritonavir",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Liquid or powder formulation available (but not very practical for adults)",
"       </td>",
"       <td>",
"        <p>",
"         Nelfinavir (very impractical)",
"        </p>",
"        <p>",
"         Stavudine (moderately impractical)",
"        </p>",
"        <p>",
"         Didanosine (somewhat cumbersome)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Good instructions and good data available but not very practical for adults",
"       </td>",
"       <td>",
"        Delavirdine (100 mg tablet only), etravirine, nelfinavir",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Instructions for opening capsules or crushing and dissolving tablets available (although little to no stability or bioavailability data available for most). Prepare immediately before ingesting.",
"       </td>",
"       <td>",
"        Atazanavir, delavirdine (200 mg tablet), darunavir, efavirenz, emtricitabine, nelfinavir, tenofovir",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        No liquid or powder formulation and little to no information on crushing or dissolving available",
"       </td>",
"       <td>",
"        Darunavir, indinavir, maraviroc, raltegravir, rilpivirine, tipranavir, saquinavir",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Coformulations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <p>",
"         Efavirenz/tenofovir/emtricitabline (Atripla);",
"        </p>",
"        <p>",
"         Lamivudine/zidovudine (Combivir);",
"        </p>",
"        <p>",
"         Lamivudine/zidovudine/abacavir (Trizivir);",
"        </p>",
"        <p>",
"         Tenofovir/emtricitabine (Truvada); and",
"        </p>",
"        <p>",
"         Lamivudine/abacavir (Epzicom)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Definitely",
"        <strong>",
"         do not",
"        </strong>",
"        crush or dissolve",
"       </td>",
"       <td>",
"        <p>",
"         Lopinavir/ritonavir tablets",
"        </p>",
"        <p>",
"         Efavirenz/emtricitabine/tenofovir coformulation (Atripla)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Injectable formulations available",
"       </td>",
"       <td>",
"        <p>",
"         Enfuvirtide (SQ injection twice daily)",
"        </p>",
"        <p>",
"         Zidovudine (intravenous)",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Amy Graziani, PharmD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
